import "./App.css";
import { Tabs, TabList, TabPanels, Tab, TabPanel } from "@chakra-ui/react";
import Header from "./component/header";
function App() {
  return (
    <>
      <Header />
      <Tabs variant="enclosed">
        <TabList>
          <Tab>
            <h1 className="text-2">One</h1>
          </Tab>
          <Tab>
            <h1 className="text-2">Two</h1>
          </Tab>
        </TabList>

        <TabPanels>
          <TabPanel>
            <p>one!</p>
          </TabPanel>
          <TabPanel>
            <p>two!</p>
          </TabPanel>
        </TabPanels>
      </Tabs>
    </>
  );
}

export default App;
